const Navbar=()=>{
    const {loggedUser}=useContext(AuthContext)
    return(
    <div className="">
   <h1 style={{display:"inline"}}>TMDB</h1>
   {!loggedUser?
   <>
   (<Link to="/login">
    <button style={{float:"right"}}>Log in</button></Link>
    <Link to="/register">
    <button style={{float:"right"}}>Register</button></Link>)</> :
    (<div>LOGUEADO</div>)}
    </div>)


}



export default Navbar
